import React, { Component } from 'react';
import {
    SafeAreaView,
    Text,
    View,
    Image,
    TouchableOpacity,
    ScrollView,
  } from "react-native";

export class CustomDrawer extends Component {
    render() {
        return (
            <SafeAreaView style={{flex:1, backgroundColor:'#FF8336'}}>
          <ScrollView style={{marginLeft:5}}>
          <TouchableOpacity 
        style={{marginTop:20}}
        onPress={()=> this.props.navigation.navigate('Menu')}
        >
            <Text>Menu</Text>
        </TouchableOpacity>
        <TouchableOpacity 
        style={{marginTop:20}}
        onPress={()=> this.props.navigation.navigate('Notification')}
        >
            <Text>Notification</Text>
        </TouchableOpacity>

          </ScrollView>
      </SafeAreaView> 
          );
    }
}
